import Axios from 'axios';
import NavBarHome from '../NavBar/NavBarHome';

export default function Home() {

	useEffect(() => {
		Axios(
			'http://localhost:4000/api/user', 
			{
				method: 'GET',
				withcredentials: true,
			}
		).then(res => {
			console.log(res);
		}
		).catch(err => {
			console.log(err);
		});
	})

	return (
		<div id="HomeForm">
			<NavBarHome/>
			<div className="Post">
				<h4>
					Comment allez-vous aujourd'hui ?
				</h4>
				<textarea type="text"> 
				</textarea>
				<button>
					Poster
				</button>
			</div>
		</div>
	)
}
